import math

import torch


__all__ = ["random_hadamard_matrix"]

# adapted from:
# https://github.com/facebookresearch/SpinQuant/blob/main/utils/hadamard_utils.py

# TODO: the following library exists for online rotations and should be considered
# in the future:
# https://github.com/Dao-AILab/fast-hadamard-transform/tree/master


def random_hadamard_matrix(size: int) -> torch.Tensor:
    """
    Produces a randomly generated Hadamard matrix.
    See https://cornell-relaxml.github.io/quip-sharp/ ,
    Section "Randomized Hadamard Transformation"

    :param size: The dimension of the matrix. Matrix generated will have dimensions
        (size, size)

    """
    # TODO: potentially update to add "seed" as an arugment, to allow
    # the matrix generated to be reproducible
    Q = torch.randint(low=0, high=2, size=(size,)).to(torch.float64)
    Q = Q * 2 - 1
    Q = torch.diag(Q)
    return _matmul_hadU(Q)


def _get_hadK(n, transpose=False):
    # NOTE: we can easily extend the list of supported shapes/sizes
    # by adding to these methods
    hadK, K = None, None
    if n % 172 == 0:  # llama-2-7b up
        assert _is_pow2(n // 172)
        K = 172
        hadK = _get_had172().T if transpose else _get_had172()
    elif n % 156 == 0:  # llama-1-30b 3x hidden
        assert _is_pow2(n // 156)
        K = 156
        hadK = _get_had156().T if transpose else _get_had156()
    elif n % 140 == 0:  # llama-1-30b intermediate
        assert _is_pow2(n // 140)
        K = 140
        hadK = _get_had140().T if transpose else _get_had140()
    elif n % 108 == 0:  # llama-1-13b intermediate
        assert _is_pow2(n // 108)
        K = 108
        hadK = _get_had108().T if transpose else _get_had108()
    elif n % 60 == 0:  # llama-1-13b 3x hidden
        assert _is_pow2(n // 60)
        K = 60
        hadK = _get_had60().T if transpose else _get_had60()
    elif n % 52 == 0:  # llama-1-13b 1x hidden
        assert _is_pow2(n // 52)
        K = 52
        hadK = _get_had52().T if transpose else _get_had52()
    elif n % 36 == 0:
        assert _is_pow2(n // 36)
        K = 36
        hadK = _get_had36().T if transpose else _get_had36()
    elif n % 28 == 0:
        assert _is_pow2(n // 28)
        K = 28
        hadK = _get_had28().T if transpose else _get_had28()
    elif n % 40 == 0:
        assert _is_pow2(n // 40)
        K = 40
        hadK = _get_had40().T if transpose else _get_had40()
    elif n % 20 == 0:
        assert _is_pow2(n // 20)
        K = 20
        hadK = _get_had20().T if transpose else _get_had20()
    elif n % 12 == 0:
        assert _is_pow2(n // 12)
        K = 12
        hadK = _get_had12().T if transpose else _get_had12()
    else:
        assert _is_pow2(n)
        K = 1

    return hadK, K


def _matmul_hadU(X, transpose=False):
    n = X.shape[-1]
    hadK, K = _get_hadK(n, transpose)
    input = X.clone().view(-1, n, 1)
    output = input.clone()
    while input.shape[1] > K:
        input = input.view(input.shape[0], input.shape[1] // 2, 2, input.shape[2])
        output = output.view(input.shape)
        output[:, :, 0, :] = input[:, :, 0, :] + input[:, :, 1, :]
        output[:, :, 1, :] = input[:, :, 0, :] - input[:, :, 1, :]
        output = output.view(input.shape[0], input.shape[1], -1)
        (input, output) = (output, input)
    del output

    # K == 1 when hadK is None; this happens when the size dim (n)
    # is not comaptible with any of the maintained hadamard matrices

    if K > 1:
        # Do not explicitly repeat - OOM
        # input = torch.bmm(
        #     hadK.repeat(len(input), 1, 1).to(input.device).to(input.dtype), input)
        # Use bcast instead
        input = hadK.view(1, K, K).to(input) @ input

    return input.view(X.shape) / torch.tensor(n).sqrt()


def _is_pow2(n):
    return (n & (n - 1) == 0) and (n > 0)


